import React from "react";
import { motion } from "framer-motion";

function About() {
  return (
    <>
      <motion.div
        initial={{ opacity: 0, y: -100 }}
        animate={{ opacity: 1, y: 0 }} 
        transition={{ duration: 0.5 }}
        viewport={{ once: true }}
        >
      <div className="about-title">
        <p>Half developer,</p>
        <p>half designer,</p>
        <p>full creative</p>
      </div>
      </motion.div>
    </>
  );
}

export default About;
